// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

contract A {
    address _owner;
    constructor(){
        _owner = msg.sender;
    }
    function changeOwnership(address newOwner) public {
        require(msg.sender == _owner);
        _owner = newOwner;
    }
    function owner() public view returns (address) {
        return _owner;
    }
}

contract B {
    constructor(A contractA){
        require(contractA.owner() == msg.sender);
        (bool success, bytes memory data) = address(contractA).delegatecall(
            abi.encodeWithSignature("changeOwnership(address)", msg.sender)
        );
        require(success, "delegatecall failed");
    }
}

